def solve():
    s = "t5 t1 t2 t0 t3 t1 t1 t4"

    def generate(grammar, input_string):
        """
        Generates if the given string is in the grammar.
        """
        stack = []
        for char in input_string:
            if char in grammar.keys():
                stack.append(char)
            else:
                if len(stack) > 0:
                    if stack[-1] in grammar.keys():
                        stack.pop()
                    else:
                        return False
        return len(stack) == 0

    if generate(s, s):
